@TonightVMTV @tweetsnolimits Utter nonsense from everyone on the show.. 
We 70k cases and no excess mortality. 
So strokes are down, heart attacks all down, flue deaths gone but we have a covid pandemic and no excess deaths. This is a nonsense, they are attributing deaths to covid. It’s a fraud.

@BorisJohnson Why when Covid is not the killer you tell us it is?
In England 44,464 people who had a COVID test in the previous 28 days died, yet only 2,130 had COVID as main cause on their death cert. So ACTUAL COVID deaths are 2,130 since March with an Avg age of 82.

The data is out there.

